import React from 'react';

export default class KalenderPopup extends React.Component {

    render() {
        return(
            <div className= "popup_outer">
                <div className= "popup_inner">
                    <button onClick={this.props.closePopup}>x</button>
                    <h3>{this.props.name}</h3>
                    
                    <ul id = "popupList">
                        <li>test: 1</li>
                        <li>bla:blub</li>
                    </ul>
                </div>
            </div>
        );
    }
}
